import Footer from '../components';
import NavHeader from '../components/headNav';
import Nav from '../components/Nav';
function DefaultLayout({children}){
    return(
        <div>
            <Nav/>
            <NavHeader/>
            {children}
            <Footer/>
        </div>
    )
}
export default DefaultLayout;
